import axios from 'axios'
import React, { useState } from 'react'

const PicApi = () => {
    const [images, setImages]= useState([])
    const getData = async ()=>{
        const res = await axios.get("https://picsum.photos/v2/list") 
        const data = res.data
        setImages([data])
        console.log(images)
        
    }
  return (
    <div>
      <button onClick={getData} style={{fontSize:"21px", padding:"10px 20px", margin:"10px", borderRadius:"7px", color:"black", border:"none", background:"grey"}}>Click</button>

      <div style={{padding:"10px"}}>
        {
           images.map((elem, id)=>{
               
                <img key={id} src={elem} style={{margin:"20px", display:"inline-block"}}
                width={300}
                height={300}
                />
            })
        }
      </div>
    </div>
  )
}

export default PicApi
